import { Route, Link } from "react-router-dom";
import Routes from './routes';

function Status({ code, children }) {
  return (
    <Route
      render={({ staticContext }) => {
        if (staticContext) staticContext.status = code;
        return children;
      }}
    />
  ); 
}

function Index() {
  return (
  <>
  <h2>Home</h2>
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about/">About</Link>
        </li>
        <li>
          <Link to="/users/">Users</Link>
        </li>
        <li>
          <Link to="/people/">People</Link>
        </li> 
        <li>
          <Link to="/posts/1">Posts</Link>
        </li> 
      </ul>
    </nav>
  </>
  );
}

function About() {
  return (
    <>
    <h2>Home</h2>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about/">About</Link>
          </li>
          <li>
            <Link to="/users/">Users</Link>
          </li>
          <li>
            <Link to="/people/">People</Link>
          </li> 
          <li>
            <Link to="/posts/1">Posts</Link>
          </li> 
        </ul>
      </nav>
    </>
    );
  }
function Users() {
  return <h2>Users</h2>;
}

function NotFound() {
  return (
    <>
      <Status code={404}/>
      <h2>Not found</h2>
    </>
  )
}

function App() {
  return(
    <div>
      <h1>Welcome to Next.js!</h1>
    <Routes />

    </div>
  );
}

export default App;
